import React from 'react';
import AppMenu from '../../components/AppMenu';

export default function status({ user }) {
  return (
    <div>
      <AppMenu user={user} />
      <h1>status</h1>
    </div>
  );
}

export async function getServerSideProps({ req, res }) {
  return {
    props: {
      user: req.user,
    },
  };
}
